import "./App.css";
import {Route, Routes} from "react-router-dom";
import Home from "./pages/home";
import Input from "./pages/Input";

function App() {
    return (
        <Routes>
            <Route path={"/"} element={<Home/>}/>
            <Route path={"/input"} element={<Input/>}/>
        </Routes>
    );
}

export default App;
